<script>
    var has_errored = false;
    window.appendErrorMessage = function(msg) {
        var loading_banner = document.getElementById("loadingBanner");
        if (!has_errored) {
            loading_banner.innerText = msg;
            has_errored = true;
        } else {
            loading_banner.innerText += '\n' + msg;
        }
        window.setStatusBannerHidden(false);
    }

    window.setStatus = function(msg) {
        if (has_errored) return;
        var loading_banner = document.getElementById("loadingBanner");
        loading_banner.innerText = msg;
    }

    window.setStatusBannerHidden = function(hidden) {
        var loading_banner = document.getElementById("loadingBanner");
        loading_banner.style.display=hidden ? "none" : "block";
    }

    if (navigator.standalone === true) {
        document.body.style.height = "100vh";
        document.body.style.width = "100vw";
        document.body.style.position = "relative";
        document.getElementById("madewith").style.display = "none";
    }
    window.exposedCFunctions = null;
    document.getElementById("loadingBanner").innerHTML="Loading";
</script>
